import React from "react";

import Card from "../UI/Card/Card";
import classes from "./Register.module.css";

const Register = () => {
  return (
    <Card className={classes.register}>
      <form>
        <h1>Register</h1>
        <div className={classes["form-control"]}>
          <label>Name</label>
          <input />
        </div>
      </form>
    </Card>
  );
};

export default Register;
